<!doctype html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>James Call Active</title>
  <style>
    :root {
      --bg: #eef3fb;
      --panel: #ffffff;
      --line: #c6d5ea;
      --text: #16324f;
      --muted: #5d7697;
      --brand: #0f5cab;
      --accent: #0086be;
      --ok: #1f9d67;
      --warn: #d4971b;
      --shadow: 0 10px 24px rgba(22, 50, 79, 0.08);
    }
    * { box-sizing: border-box; }
    body {
      margin: 0;
      font-family: "Avenir Next", "Segoe UI", sans-serif;
      background: linear-gradient(180deg, #f7faff 0%, var(--bg) 100%);
      color: var(--text);
    }
    .app {
      min-height: 100vh;
      padding: 14px;
      display: grid;
      gap: 10px;
    }
    .brandbar {
      padding: 2px 0;
      display: flex;
      justify-content: space-between;
      align-items: center;
      gap: 12px;
      background: transparent;
      border: none;
      box-shadow: none;
    }
    .brand-left {
      display: inline-flex;
      align-items: center;
    }
    .brand-plate {
      background: #ffffff;
      border: 1px solid #d1dff2;
      border-radius: 10px;
      padding: 8px 12px;
      box-shadow: var(--shadow);
      display: inline-flex;
      align-items: center;
      min-height: 54px;
    }
    .brand-logo {
      display: block;
      height: 40px;
      width: auto;
      object-fit: contain;
    }
    .top-controls {
      display: inline-flex;
      align-items: center;
      gap: 7px;
    }
    .tiny-audio {
      width: 14px;
      height: 14px;
      border-radius: 999px;
      border: 1px solid #aec4e2;
      background: #edf4ff;
      color: transparent;
      font-size: 0;
      cursor: pointer;
      padding: 0;
    }
    .chip {
      border: 1px solid #b8cfea;
      border-radius: 999px;
      padding: 3px 8px;
      font-size: 0.66rem;
      color: #375b88;
      background: #f2f7ff;
      white-space: nowrap;
    }
    .layout {
      display: grid;
      grid-template-columns: minmax(760px, 1.45fr) minmax(400px, 1fr);
      gap: 10px;
      align-items: start;
    }
    .primary,
    .secondary {
      display: grid;
      gap: 10px;
    }
    .card {
      background: var(--panel);
      border: 1px solid var(--line);
      border-radius: 11px;
      padding: 10px;
      box-shadow: var(--shadow);
    }
    .card-head {
      display: flex;
      justify-content: space-between;
      align-items: center;
      gap: 8px;
      margin-bottom: 8px;
    }
    .card h2 {
      margin: 0;
      font-size: 0.82rem;
      text-transform: uppercase;
      letter-spacing: 0.38px;
      color: #1a4272;
    }
    .crm-card {
      border-top: 4px solid var(--brand);
      padding-top: 8px;
    }
    .identity-strip {
      display: grid;
      grid-template-columns: repeat(4, minmax(140px, 1fr));
      gap: 7px;
      margin-bottom: 9px;
    }
    .id-item {
      border: 1px solid #cfe0f5;
      border-radius: 8px;
      background: #f7fbff;
      padding: 7px;
      min-height: 54px;
    }
    .id-item small {
      display: block;
      font-size: 0.62rem;
      text-transform: uppercase;
      letter-spacing: 0.3px;
      color: #5f7da5;
      margin-bottom: 2px;
    }
    .id-item strong {
      display: block;
      font-size: 0.78rem;
      color: #173d6a;
      line-height: 1.25;
    }
    .crm-grid {
      display: grid;
      grid-template-columns: 1fr 1fr;
      gap: 8px;
    }
    .crm-grid label {
      display: grid;
      gap: 3px;
      font-size: 0.64rem;
      color: #5d7698;
      text-transform: uppercase;
      letter-spacing: 0.2px;
    }
    .crm-grid input,
    .crm-grid textarea {
      width: 100%;
      border: 1px solid #c2d5f1;
      border-radius: 7px;
      padding: 7px 8px;
      font-size: 0.75rem;
      background: #f9fcff;
      color: #234568;
    }
    .crm-grid .full { grid-column: span 2; }
    .assurance-grid {
      display: grid;
      grid-template-columns: 1fr 1fr;
      gap: 10px;
    }
    .verify-grid {
      display: grid;
      grid-template-columns: 1fr 1fr;
      gap: 6px;
      min-height: 146px;
      align-content: start;
    }
    .verify-row {
      display: flex;
      justify-content: space-between;
      align-items: center;
      border: 1px solid #d2e0f4;
      border-radius: 8px;
      background: #f8fbff;
      padding: 6px 8px;
      gap: 8px;
      min-height: 36px;
    }
    .verify-text {
      font-size: 0.71rem;
      color: #24456d;
      font-weight: 600;
      line-height: 1.25;
      white-space: nowrap;
      overflow: hidden;
      text-overflow: ellipsis;
    }
    .list {
      display: grid;
      gap: 6px;
      max-height: 260px;
      overflow: auto;
      align-content: start;
    }
    .item {
      border: 1px solid #d1e0f6;
      border-radius: 8px;
      padding: 7px;
      background: #f8fbff;
      font-size: 0.75rem;
      color: #27466e;
    }
    .item strong {
      display: block;
      color: #173f72;
      margin-bottom: 3px;
      font-size: 0.77rem;
    }
    .item small {
      color: #5f7da5;
      font-size: 0.69rem;
    }
    .status {
      border-radius: 999px;
      padding: 2px 7px;
      font-size: 0.64rem;
      text-transform: uppercase;
      letter-spacing: 0.2px;
      border: 1px solid transparent;
      white-space: nowrap;
    }
    .status.pass {
      color: var(--ok);
      border-color: #8fd9ba;
      background: #edf9f3;
      box-shadow: 0 0 0 1px rgba(31, 157, 103, 0.14) inset, 0 0 9px rgba(86, 196, 142, 0.24);
    }
    .status.pending {
      color: var(--warn);
      border-color: #f0d493;
      background: #fff8e8;
      box-shadow: 0 0 0 1px rgba(212, 151, 27, 0.12) inset, 0 0 9px rgba(220, 164, 50, 0.2);
    }
    .feed {
      display: grid;
      gap: 6px;
      max-height: 330px;
      overflow: auto;
      padding-right: 2px;
      align-content: start;
    }
    .line {
      border: 1px solid #d5e3f8;
      border-left-width: 4px;
      border-radius: 8px;
      padding: 7px;
      background: #fbfdff;
    }
    .line.agent { border-left-color: var(--accent); }
    .line.customer { border-left-color: var(--brand); }
    .line.active {
      border-color: #86b1e7;
      box-shadow: 0 0 0 1px rgba(15, 92, 171, 0.12) inset;
      background: #f3f8ff;
    }
    .line small {
      display: block;
      margin-bottom: 2px;
      font-size: 0.67rem;
      color: #5d7ca6;
      text-transform: uppercase;
      letter-spacing: 0.2px;
    }
    .line p {
      margin: 0;
      font-size: 0.78rem;
      line-height: 1.35;
      color: #1a3458;
      min-height: 16px;
    }
    .kb-list {
      display: grid;
      gap: 6px;
      max-height: 160px;
      overflow: auto;
    }
    .kb-btn {
      border: 1px solid #c8dcf7;
      border-radius: 8px;
      background: #f7fbff;
      text-align: left;
      padding: 7px;
      color: #1e477d;
      font-size: 0.72rem;
      cursor: pointer;
      display: grid;
      gap: 2px;
    }
    .kb-btn.active {
      border-color: var(--brand);
      box-shadow: 0 0 0 1px rgba(15, 92, 171, 0.2) inset;
      background: #eef6ff;
    }
    .kb-btn small { color: #5f7da5; font-size: 0.66rem; }
    .kb-frame {
      margin-top: 8px;
      width: 100%;
      min-height: 158px;
      border: 1px solid #c8d9ef;
      border-radius: 8px;
      background: #ffffff;
    }
    .hide { display: none; }
    @media (max-width: 1320px) {
      .layout { grid-template-columns: 1fr; }
      .assurance-grid,
      .crm-grid,
      .identity-strip,
      .verify-grid { grid-template-columns: 1fr; }
      .crm-grid .full { grid-column: auto; }
    }
  </style>
</head>

    function parseTs(ts) {
      const match = ts.match(/(\d{2}):(\d{2}):(\d{2}),(\d{3})/);
      if (!match) return 0;
      const hh = Number(match[1]);
      const mm = Number(match[2]);
      const ss = Number(match[3]);
      const ms = Number(match[4]);
      return hh * 3600 + mm * 60 + ss + ms / 1000;
    }

    function parseSrt(source) {
      return source
        .trim()
        .split(/\n\s*\n/)
        .map((block) => block.split("\n").map((line) => line.trim()))
        .filter((lines) => lines.length >= 2)
        .map((lines) => {
          const timeLine = lines.find((line) => line.includes(" --> ")) || "";
          const [startRaw = "", endRaw = ""] = timeLine.split(" --> ");
          const textLine = lines
            .filter((line) => !/^\d+$/.test(line) && !line.includes(" --> "))
            .join(" ")
            .trim();

          let speaker = "Unknown";
          let text = textLine;

          const bracketMatch = textLine.match(/^\[([^\]]+)\]\s*(.*)$/);
          const colonMatch = textLine.match(/^([A-Za-z][A-Za-z0-9 _-]{1,24}):\s*(.*)$/);

          if (bracketMatch) {
            speaker = bracketMatch[1].trim();
            text = bracketMatch[2].trim();
          } else if (colonMatch) {
            speaker = colonMatch[1].trim();
            text = colonMatch[2].trim();
          }

          const isAgent = /james|sarah|aria|agent|voicebot/i.test(speaker);
          const isCustomer = /maria|david|customer/i.test(speaker);

          return {
            start: parseTs(startRaw),
            end: parseTs(endRaw),
            speaker,
            role: isAgent ? "agent" : isCustomer ? "customer" : "unknown",
            text,
            words: text.split(/\s+/).filter(Boolean)
          };
        })
        .filter((cue) => cue.end > cue.start && cue.text.length > 0);
    }

    function pad2(n) {
      return String(n).padStart(2, "0");
    }

    function revealCueText(cue, sec) {
      if (sec <= cue.start) return "";
      if (sec >= cue.end) return cue.text;
      const span = Math.max(0.001, cue.end - cue.start);
      const progress = Math.max(0, Math.min(1, (sec - cue.start) / span));
      const count = Math.floor(progress * cue.words.length);
      if (count <= 0) return "";
      return cue.words.slice(0, count).join(" ");
    }

    function renderKbArticle(article) {
      const steps = article.steps.map((step) => `<li>${step}</li>`).join("");
      return `<!doctype html><html><head><style>
        body{margin:0;padding:10px;background:#f7fbff;font-family:Avenir Next,Segoe UI,sans-serif;color:#153a67}
        h1{margin:0 0 5px;font-size:14px}p{margin:0 0 8px;font-size:12px;line-height:1.4}
        ul{margin:0;padding-left:18px;font-size:12px;display:grid;gap:4px}
      </style></head><body><h1>${article.id} | ${article.title}</h1><p>${article.summary}</p><ul>${steps}</ul></body></html>`;
    }

    function scoreKb(heardText, article) {
      let hits = 0;
      article.tags.forEach((tag) => {
        if (heardText.includes(tag)) hits += 1;
      });
      return hits;
    }

    function renderKbRanking(heardText) {
      const ranked = kbArticles
        .map((article) => ({ article, score: scoreKb(heardText, article) }))
        .sort((a, b) => b.score - a.score);

      const top = ranked[0]?.article || kbArticles[0];
      const confidence = Math.min(98, 45 + (ranked[0]?.score || 0) * 18);
      ui.kbConfidence.textContent = `Top match ${confidence}%`;

      if ((ranked[0]?.score || 0) > 0) {
        selectedKbId = top.id;
      }

      ui.kbList.innerHTML = ranked
        .map((entry) => {
          const active = entry.article.id === selectedKbId ? "active" : "";
          return `<button type='button' data-kb='${entry.article.id}' class='kb-btn ${active}'>${entry.article.id} | ${entry.article.title}<small>Likelihood score: ${entry.score}</small></button>`;
        })
        .join("");

      ui.kbList.querySelectorAll("button").forEach((button) => {
        button.addEventListener("click", () => {
          selectedKbId = button.getAttribute("data-kb") || top.id;
          ui.kbFrame.srcdoc = renderKbArticle(kbArticles.find((k) => k.id === selectedKbId) || top);
          renderKbRanking(heardText);
        });
      });

      ui.kbFrame.srcdoc = renderKbArticle(kbArticles.find((k) => k.id === selectedKbId) || top);
      return { ranked, top, confidence };
    }

      if (ui.audio.paused) {
        if (ui.audio.currentTime >= (ui.audio.duration || 0) - 0.05) {
          ui.audio.currentTime = 0;
          ui.transcriptFeed.innerHTML = "";
        }
        await ui.audio.play();
        ui.audioBtn.setAttribute("aria-label", "pause");
      } else {
        ui.audio.pause();
        ui.audioBtn.setAttribute("aria-label", "play");
      }
    });

    ui.audio.addEventListener("timeupdate", refreshUi);
    ui.audio.addEventListener("seeked", () => {
      ui.transcriptFeed.innerHTML = "";
      refreshUi();
    });
    ui.audio.addEventListener("ended", () => {
      ui.audioBtn.setAttribute("aria-label", "play");
      refreshUi();
    });

    loadCues();
  </script>
</body>
</html>
